import { useState, useEffect } from 'react';
import "./style.css";
import Post from './records.json';

export default function DataFetching() {

    const [posts, setPosts] = useState([]);

    useEffect(() => {    
        fetch('records.json')
            .then(res => res.json())
            .then(data => setPosts(data.posts));
    }, []);

    return (
    <div className="post">
        <>
       
        {Post?.map(post => (
            <li key={post.id}>
                <h3>{post.title}</h3>
            </li>
        ))}
        </>
    </div>
    )
}
